import React from 'react';
import './topnav.css';
function App() {
    return (
      <div className="topNav">
        <svg className="topNavSVG" viewBox="0 0 21.055 8.546" height={32.3} width={79.578} {...props}>
            <defs>
                <radialGradient
                gradientUnits="userSpaceOnUse"
                gradientTransform="matrix(-.15696 .00018 -.0001 -.08285 106.78 89.998)"
                r={125}
                fy={66.752}
                fx={76.011}
                cy={66.752}
                cx={76.011}
                id="prefix__c"
                xlinkHref="#prefix__a"
                />
                <radialGradient
                gradientUnits="userSpaceOnUse"
                gradientTransform="matrix(-.42222 .43796 -.43862 -.42286 197.936 -20.033)"
                r={39.789}
                fy={4.737}
                fx={238.498}
                cy={4.737}
                cx={238.498}
                id="prefix__d"
                xlinkHref="#prefix__b"
                />
                <linearGradient id="prefix__a">
                <stop offset={0} stopColor="#fff" />
                <stop offset={1} stopOpacity={0.213} />
                </linearGradient>
                <linearGradient id="prefix__b">
                <stop offset={0} stopColor="#f80300" />
                <stop offset={1} stopColor="#cb0200" />
                </linearGradient>
            </defs>
            <path
                d="M95.232 78.882c-1.396 0-2.78.02-3.795.06h-6.714v2.164a.558.558 0 01.002.052v2.097c.418.725 4.37 3.772 5.235 3.995.913.237 9.632.237 10.545 0 .913-.236 5.273-3.622 5.273-4.095v-4.213h-6.75c-1.016-.04-2.4-.06-3.796-.06z"
                fill="url(#prefix__c)"
                transform="translate(-84.723 -78.882)"
            />
            <path
                d="M95.232 78.887c-1.396 0-2.78.019-3.795.055h-6.714v1.97a.462.462 0 01.002.047v1.909c.418.66 4.37 3.432 5.235 3.636.913.215 9.632.215 10.545 0 .913-.215 5.272-3.297 5.272-3.728v-3.834h-6.749a114.66 114.66 0 00-3.796-.055z"
                fill="url(#prefix__d)"
                transform="translate(-84.723 -78.882)"
            />
        </svg>
      </div>
    );
  }
  
  export default App;
